import React from "react";

export default function ResumeSkills(props) {
  const skills = props.skills.map((skill) => skill);
  return (
    <div className="resume-skills">
      <h4>Skills</h4>
      <ul>
        <li>{skills}</li>
      </ul>
      <hr className="divider" />
    </div>
  );
}
